import React, { Component } from 'react';
import './Recommend_Venue.css';
import axios from 'axios';
import Company from './Components/Company';
import Venue from './Components/Venue';
import Header from './Components/Header';
import Form from './Components/Form';
import Footer from './Components/Footer';

export default class Recommend_Venue extends Component {

  state = {
    venue: 's'
  }


  componentDidMount() {

    axios.get(`https://api.staging.hfg.clients.pipelabs.com.au/venue/5cade65ea95a8400115274e3/recommendations`,
      { headers: {"Authorization" : 'Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjVjYWRkZGMwYzM4NTRmMDAxMTNkNzE0MSIsImVtYWlsIjoibWF0dEBwaXBlbGFicy5jb20uYXUiLCJmaXJzdE5hbWUiOiJNYXR0IiwibGFzdE5hbWUiOiJIYXl3YXJkIiwiZnVsbE5hbWUiOiJNYXR0IEhheXdhcmQiLCJ0eXBlIjoiQURNSU4iLCJpYXQiOjE1NTcyMDY0MzcsImV4cCI6MTU4ODc0MjQzN30.ItkthOpAQ_OVexdSaRfAEYv4UL1t7QUHsUs5sRaps-8'} })
      .then(res => {
        const venue = res.data;
        this.setState({ venue: venue.recommendations[0].venue });
        console.log(this.state.venue.address.locality);
      })
  }

  render() {
    if(this.state.venue==null){
      return (
      <div className="App-header App">
        Loading...
      </div>)
    }else{
    return (
      <div>
          <Header/>
          <div className="flex-container-row all-container">
            <Venue className="venue-container"
            name= {this.state.venue.name}            
            imageUrl= {this.state.venue.mainPhoto}
            location={this.state.venue.address.locality}
            dietaries={this.state.venue.dietaries}
            // website={this.state.chef.venue.website} 
            //number={this.state.venue.venue.photos.length}
            />
            <Company className="company-container" />
          </div>
          <div id="Download" className="download">
            <Form/>
          </div>
          <Footer/>
      </div>
    )}
  }
}
